import React, { useState } from "react";

interface Customer {
  customerId: number;
  name: string;
  city: string;
  contactNumber: string;
  year: number;
  photo: string;
  totalPurchasesPerYear: number;
}

const CustCrud: React.FC = () => {
  return (
    <>
      <h2>Customer Management</h2>
      <div>
        <h3>Add / Edit Customer</h3>
        <input type="text" name="name" placeholder="Name" />
        <input type="text" name="city" placeholder="City" />
        <input type="text" name="contactNumber" placeholder="Contact Number" />
        <input type="number" name="year" placeholder="Year" />
        <input type="text" name="photo" placeholder="Photo URL" />
        <input
          type="number"
          name="totalPurchasesPerYear"
          placeholder="Total Purchases"
        />
        <button>Add Customer</button>
      </div>
      <div>
        <h3>Customer List</h3>
        <ul>
          <li>
            <p>Name: Priyanka</p>
            <p>City: New York</p>
            <p>Contact: 123-456-7890</p>
            <p>Year: 2024</p>
            <img src="https://via.placeholder.com/50" alt="John Doe" />
            <p>Total Purchases: $1200</p>
            <button>Edit</button>
            <button>Delete</button>
          </li>
          {/* Add more list items as needed */}
        </ul>
      </div>

    </>
  );
};

export default CustCrud;
